model.av_snowflake.fact_customer_nps_tre.raw_code:
WITH cust AS (
    SELECT * FROM {{ref("customer")}}
), dim_sf_customers AS (
    SELECT * FROM {{ref("dim_sf_customers")}}
), cust_timeline AS (
    SELECT * FROM {{ref("customer_timeline")}}
), current_year_forecast AS (
    SELECT * FROM {{ref("dimh_sf_account__current_year_risk_forecast")}}
), next_year_forecast AS (
    SELECT * FROM {{ref("dimh_sf_account__next_year_risk_forecast")}}
), date_dim AS (
    SELECT * FROM {{ref("dim_date")}} where date >= '1/1/2023' and date <= CURRENT_TIMESTAMP()
), cust_monthly AS (
    select distinct date_dim.first_date_of_month
        ,date_dim.last_date_of_month
        ,cust.sf_account_id
    from date_dim FULL OUTER JOIN cust on 1=1
), nps_surveys AS (
    select * from {{ref("dim_sf_nps_surveys")}}
)
select cm.first_date_of_month
    ,cm.last_date_of_month
    ,cm.sf_account_id
    ,COUNT(ns.survey_response_id) as count_total_surveys
    ,AVG(how_likely_to_recommend_allvue) as average_recommendation_score
    ,SUM(count_promotor) AS count_promotor
    ,SUM(count_passive) as count_passive
    ,SUM(count_detractor) as count_detractor
from cust_monthly cm LEFT join nps_surveys ns on cm.sf_account_id = ns.account_id and ns.completion_date >= cm.first_date_of_month and ns.completion_date <= cm.last_date_of_month
where ns.survey_response_id is not null
group by cm.first_date_of_month
    ,cm.last_date_of_month
    ,cm.sf_account_id

model.av_snowflake.fact_customer_risk_pr.raw_code:
WITH cust AS (
    SELECT * FROM {{ref("customer")}}
), dim_sf_customers AS (
    SELECT * FROM {{ref("dim_sf_customers")}}
), cust_timeline AS (
    SELECT * FROM {{ref("customer_timeline")}}
), current_year_forecast AS (
    SELECT * FROM {{ref("dimh_sf_account__current_year_risk_forecast")}}
), next_year_forecast AS (
    SELECT * FROM {{ref("dimh_sf_account__next_year_risk_forecast")}}
), date_dim AS (
    SELECT * FROM {{ref("dim_date")}} where date >= '5/1/2024' and date <= CURRENT_TIMESTAMP()
), cust_monthly AS (
    select distinct date_dim.first_date_of_month
        ,date_dim.last_date_of_month
        ,cust.sf_account_id
    from date_dim FULL OUTER JOIN cust on 1=1
)
select cm.first_date_of_month
    ,cm.last_date_of_month
    ,cm.sf_account_id
    ,COALESCE(cyf.current_year_risk_forecast_percent,dc.risk_forecast_pct_current_year) as risk_forecast_pct_current_year
    ,COALESCE(nyf.next_year_risk_forecast_percent,dc.risk_forecast_pct_next_year) as risk_forecast_pct_next_year
    ,CASE WHEN ct.last_product_rider_end_date >= cm.first_date_of_month AND cm.first_date_of_month > ct.first_msa_start_date THEN 'active'
          WHEN ct.last_product_rider_end_date < cm.first_date_of_month THEN 'terminated' 
          WHEN cm.first_date_of_month <= ct.first_msa_start_date THEN 'prospect'
          ELSE 'terminated' END::VARCHAR as status
from cust_monthly cm LEFT JOIN current_year_forecast cyf on cm.sf_account_id = cyf.account_id and cm.last_date_of_month > cyf.effective_date_start and cm.last_date_of_month <= cyf.effective_date_end
                     LEFT JOIN next_year_forecast nyf on cm.sf_account_id = nyf.account_id and cm.last_date_of_month > nyf.effective_date_start and cm.last_date_of_month <= nyf.effective_date_end
                     LEFT JOIN dim_sf_customers dc on cm.sf_account_id = dc.account_id
                     LEFT JOIN cust_timeline ct on cm.sf_account_id = ct.sf_account_id

model.av_snowflake.fact_customer_data_ri.raw_code:
WITH customer_contracts AS (
    select * from {{ref("customer_contracts")}}
), fact_cust_status AS (
    SELECT * FROM {{ref("fact_customer_status")}}
)
select fcs.date as date
    ,fcs.sf_account_id as sf_account_id
    ,CASE WHEN cc.has_data_rights = true and fcs.is_active = true then true else false END::BOOLEAN as has_data_rights
    ,CASE WHEN cc.has_data_rights = true and fcs.is_active = true then 1 else 0 END::INT as has_data_rights_count
    ,CASE WHEN cc.has_data_rights = true and fcs.is_active = true then cc.data_rights else NULL END::VARCHAR as data_rights_clause
from fact_cust_status fcs LEFT JOIN customer_contracts cc on fcs.sf_account_id = cc.sf_account_id and cc.data_rights_last_updated >= fcs.date

model.av_snowflake.fact_pi_epic_in_scope.raw_code:
{#
    Jira Epics are considered in scope for a PI when the PI Attribute was set during the pi window
#}

WITH dim_date AS (
    SELECT * FROM {{ref("dim_date")}}
), pis AS (
    SELECT * FROM {{ref("dim_litheo_corp_pis")}} where id = 7
), epic_pi_attr as (
    SELECT * FROM {{ref("dim_jira_pi_epic")}}
)
SELECT distinct d.date
        ,p.id as pi_id
        ,pa.issue_id as epic_id
FROM dim_date d JOIN pis p on d.date >= p.start_date AND d.date <= p.end_date
                LEFT JOIN epic_pi_attr pa ON p.jira_pi_name = pa.pi_name
                                            AND d.last_datetime_of_day >= pa.effective_date_start
                                            AND d.first_datetime_of_day <= pa.effective_date_end

model.av_snowflake.fact_pi_epic_wi_in_sc.raw_code:
{#
    Jira Workitems are considered to be inscope if as of a day in the pi window, the workitem existed on a sprint aligned to that pi
    - Any Epics associated to those workitems at the end of that day will also be considered as inscope
#}

WITH dim_date AS (
    SELECT * FROM {{ref("dim_date")}}
), pis AS (
    SELECT * FROM {{ref("corp_pi")}} where id = 7
), sprint_workitems as (
    SELECT * FROM {{ref("dim_jira_sprint_workitems")}}
), corp_sprints AS (
    SELECT * FROM {{ref("corp_sprint")}}
), team_sprints AS (
    SELECT * FROM {{ref("team_sprint")}}
), team_sprint_by_pi AS (
    SELECT pis.id as pi_id
            ,pis.name as pi_name
            ,pis.start_date as pi_start_date
            ,pis.end_date as pi_end_date
            ,cs.id as cs_id
            ,cs.name as cs_name
            ,ts.id as ts_id
            ,ts.name as ts_name
    FROM pis JOIN corp_sprints cs on pis.id = cs.corp_pi_id
            JOIN team_sprints ts on ts.corp_sprint_id = cs.id
)
SELECT d.date
    ,p.*
    ,tsp.*
FROM dim_date d JOIN pis p on d.date >= p.start_date AND d.date <= p.end_date
                JOIN team_sprint_by_pi tsp on p.id = tsp.pi_id


