model.av_snowflake.dim_jira_users.raw_code:
WITH portal_users AS (
    SELECT * FROM {{ref("jira_portal_only_customers")}}
), managed_users AS (
    SELECT * FROM {{ref("jira_managed_users")}}
), users_all AS (
    SELECT * FROM {{ref("jira_users")}}
)
SELECT ua.accountid AS account_id
    ,ua.active AS active
    ,COALESCE(pu.full_name,ua.displayname) AS displayname
    ,ua.accounttype AS accounttype
    ,COALESCE(ua.emailaddress,mu.email,pu.email) AS emailaddress
    ,CASE WHEN ua.accounttype = 'atlassian' THEN true ELSE false END::BOOLEAN as is_managed_user
    ,mu.last_active AS managed_user_last_activity_date
    ,mu.account_status AS managed_user_account_status
    ,CASE WHEN ua.accounttype = 'customer' THEN true ELSE false END::BOOLEAN AS is_portal_only_user
    ,pu.last_login AS portal_user_last_login
    ,pu.raw_updated AS portal_user_last_login_update
FROM users_all ua LEFT JOIN managed_users mu ON ua.accountid = mu.account_id
                  LEFT JOIN portal_users pu ON ua.accountid = pu.username

model.av_snowflake.dim_openair_project_d.raw_code:
WITH dim_date AS (
    SELECT * FROM {{ref("dim_date")}}
), dim_oa_project AS (
    SELECT * FROM {{ref("dim_openair_project")}}
), dimh_oa_project AS (
    SELECT * FROM {{ref("dimh_openair_project")}}
), dim_oa_timeentry AS (
    SELECT * FROM {{ref("dim_openair_time_entries")}}
), first_last_time_entry AS (
    select p.id
        ,min(time_entry_date) as first_time_entry
        ,max(time_entry_date) as last_time_entry
    from dim_oa_project p JOIN dim_oa_timeentry t on p.id = t.project_id
    group by p.id
), snap_creation_date AS (
    select id
        ,min(effective_date_start)::timestamp_NTZ as first_creation_snapshot_date
        ,max(effective_date_end)::timestamp_NTZ as last_snapshot_date
    from dimh_oa_project
    --where is_first_snapshot = true
    group by id
)
select dop.id
    ,dop.start_date as start_date
    ,dop.close_completed_date as close_completed_date
    ,te.first_time_entry as first_time_entry
    ,te.last_time_entry as last_time_entry
    ,scd.first_creation_snapshot_date as first_creation_snapshot_date
    ,scd.last_snapshot_date as last_snapshot_date
from dim_oa_project dop LEFT JOIN first_last_time_entry te on dop.id = te.id
                        LEFT JOIN snap_creation_date scd on dop.id = scd.id
where dop.backlog_trend_group != 'na'

model.av_snowflake.dim_openair_project_t.raw_code:
WITH dim_date AS (
    SELECT * FROM {{ref("dim_date")}}
), dim_oa_task AS (
    SELECT * FROM {{ref("dim_openair_project_task")}}
), dimh_oa_task AS (
    SELECT * FROM {{ref("dimh_openair_project_task")}}
), dim_oa_timeentry AS (
    SELECT * FROM {{ref("dim_openair_time_entries")}}
), first_last_time_entry AS (
    select t.project_task_id
        ,min(te.time_entry_date) as first_time_entry
        ,max(te.time_entry_date) as last_time_entry
    from dim_oa_task t JOIN dim_oa_timeentry te on t.project_task_id = te.project_task_id
    group by t.project_task_id
), snap_creation_date AS (
    select project_task_id
        ,min(effective_date_start)::timestamp_NTZ as first_creation_snapshot_date
    from dimh_oa_task
    where is_first_snapshot = true
    group by project_task_id
)
select dop.project_task_id
    ,dop.project_id
    ,dop.start_date as start_date
    ,dop.finish_date as finish_date
    ,te.first_time_entry as first_time_entry
    ,te.last_time_entry as last_time_entry
    ,dop.planned_go_live_date AS planned_go_live_date
    ,dop.revised_actual_go_live_date AS revised_actual_go_live_date
    ,scd.first_creation_snapshot_date as first_creation_snapshot_date
from dim_oa_task dop LEFT JOIN first_last_time_entry te on dop.project_task_id = te.project_task_id
                        LEFT JOIN snap_creation_date scd on dop.project_task_id = scd.project_task_id

